export default function Dropdown() {
  return (
    <div className="dropdown">
      <div className="dropdown-btn">Choose a day</div>
      <div className="dropdown-content">
        <div className="dropdown-item">MON</div>
        <div className="dropdown-item">TUE</div>
        <div className="dropdown-item">WED</div>
        <div className="dropdown-item">THU</div>
        <div className="dropdown-item">FRI</div>
      </div>
    </div>
  );
}
